#include <iostream>
#include <vector>
using namespace std;

#define ACTION 4
int actX[ACTION] = {0, 0, 1, -1};
int actY[ACTION] = {1, -1, 0, 0};

int Glenth = 0;
int Gwidth = 0;

void DFSTraver(vector<vector<char>>& board, int x, int y)
{
	if(board[x][y] != 'O')
		return;

	board[x][y] = 'V';
	for(int i = 0; i< ACTION; i++)
	{
		int tempX = x + actX[i];
		int tempY = y + actY[i];
		if(tempX >= 0 && tempX < Glenth && tempY >=0 && tempY < Gwidth && board[tempX][tempY] == 'O')
			DFSTraver(board, tempX, tempY);
	}
}
void solve(vector<vector<char>> &board) {
        // Start typing your C/C++ solution below
        // DO NOT write int main() function
	int lenth = board.size();
	if(board.empty()) return;
	int width = board[0].size();

	Glenth = lenth;
	Gwidth = width;
	//start from top row
	for(int i = 0; i< lenth; i++)
	{
		if(board[i][0] == 'O')
			DFSTraver(board, i, 0);
	}

	//start from bottom row
	for(int i = 0; i< lenth; i++)
	{
		if(board[i][width - 1] == 'O')
			DFSTraver(board, i, width - 1);
	}

	//start from the left column
	for(int j = 0; j < width; j++)
	{
		if(board[0][j] == 'O')
			DFSTraver(board, 0, j);
	}

	//start from the right column
	for(int j = 0; j < width; j++)
	{
		if(board[lenth - 1][j] == 'O')
			DFSTraver(board, lenth - 1, j);
	}

	for(int i = 0; i< lenth; i++)
	{
		for(int j = 0; j < width; j ++)
		{
			if(board[i][j] == 'O')
				board[i][j] = 'X';
			if(board[i][j] == 'V')
				board[i][j] = 'O';
		}
	}
}

